import React from 'react';
import PropTypes from 'prop-types';


const Card = props => {
    const {charac} = props;
    return (
        <div className="card">
            <h2 className="name">{charac.name}</h2>
            <img className="img" src={charac.image} alt={charac.name}/>
        </div>
    );
};

Card.propTypes = {
    charac: PropTypes.object.isRequired
}
export default Card;
